import { Component } from "react";
import Register from "./Register";
import Header from "./commons/Header";
import Footer from "./commons/Footer";

class MainLoginPage extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div>
        <Header />
        <Register />
        <Footer />
      </div>
    );
  }
}

export default MainRegisterPage;
